from collections import defaultdict
class Solution(object):
    def checkInclusion(self, s1, s2):
        """
        :type s1: str
        :type s2: str
        :rtype: bool
        """
        stringSet=defaultdict(int)
        s2StringSet=defaultdict(int)
        for i in s1:
            stringSet[i]+=1
        l=0

        for r in range(len(s2)):
            if s2[r] in stringSet:
                s2StringSet[s2[r]]+=1

                if(s2StringSet[s2[r]]>stringSet[s2[r]]):
                    while(s2StringSet[s2[r]]>stringSet[s2[r]]):
                        s2StringSet[s2[l]]-=1
                        l+=1
                if(s2StringSet[s2[r]]<=stringSet[s2[r]]) :
                    if(stringSet==s2StringSet):
                        return True
                continue
                

                
                
            else:          
                s2StringSet=defaultdict(int)
            
                l=r
        
        return False
    
